import axios from 'axios';
import { useEffect, useState } from 'react';
import * as React from 'react';
import NavbarOption from './navbar';

function ItemDetails(props) {
  const { item } = props;
  return (
    <div>
      <NavbarOption />
      {item.id}
    </div>
  );
}

export default ItemDetails;
